import React from "react";

function UserPaje(props)
{

    const [wishs, setWishs] = React.useState([{id:0, present:"", price:"", reservUser:0, userId:0, userName:""}])
    useEffect(()=>{
        const get = async () =>{
          const data = await GetWishs(props.id);
          setWishs(data);
        }
        get();
      }, []);

      if(wishs[0].id==0)
        return(<></>);   

      const change = (id) => {
        window.location.replace("http://localhost:3000/change/"+id)
      }

      const listItemsNotReserv = wishs.map((wish) =>
        wish.reservUser==null ?
        <ul key={wish.id} className="selfWish">
          <li>
            Подарок: {wish.present}
            <button className="delButton" onClick={() => DelWish(wish.id)}>Удалить</button>
            <button className="changeButton" onClick={() => change(wish.id)}>Изменить</button>
          </li>
          <li>
            Цена: {wish.price}
          </li>
        </ul> 
        : null 
      );
}
export default UserPaje
